
import "../styles/PhotoShoot/PhotoShootPage.css";
import ImageComposer from "../components/PhotoShoot/FrameComposer/FrameComposer.tsx";
import PhotoCapture from "../components/PhotoShoot/PhotoCapture/PhotoCapture.tsx";
import FrameSelection from  "../components/PhotoShoot/FrameSelection/FrameSelection.tsx"
import ImageGenerator from "../components/PhotoShoot/ImageGenerator/ImageGenerator.tsx"

// import test_img from "../assets/test/all_test.png"

import {useMemo, useState} from 'react';
import PhotoCaptureContext from '../contexts/PhotoCaptureContextType.ts';
import type {CaptureImageData, ImgPlaceData, PhotoCaptureContextType, ModeType} from '../types/types.ts';

function PhotoShootPage() {
  const [mode, setMode] = useState<ModeType>('frame');
  const [url, seturl] = useState<string>('');

  // test data
  // const [captureImageData, setCaptureImgData] = useState<CaptureImageData[]>([
  //   {id: 0, ratio: '16:9', base64Img:"data:image/jpeg;base64,"},
  //   {id: 1, ratio: '16:9', base64Img:"data:image/jpeg;base64,"},
  //   {id: 2, ratio: '4:3', base64Img:"data:image/jpeg;base64,"},
  //   {id: 3, ratio: '4:3', base64Img:"data:image/jpeg;base64,"},
  //   {id: 4, ratio: '3:4', base64Img:"data:image/jpeg;base64,"},
  //   {id: 5, ratio: '3:4', base64Img:"data:image/jpeg;base64,"},
  //   {id: 6, ratio: '1:1', base64Img:"data:image/jpeg;base64,"},
  //   {id: 7, ratio: '1:1', base64Img:"data:image/jpeg;base64,"},
  // ])

  const [captureImageData, setCaptureImgData] = useState<CaptureImageData[]>([
    {id: 0, ratio: '16:9', base64Img:''},
    {id: 1, ratio: '16:9', base64Img:''},
    {id: 2, ratio: '4:3', base64Img:''},
    {id: 3, ratio: '4:3', base64Img:''},
    {id: 4, ratio: '3:4', base64Img:''},
    {id: 5, ratio: '3:4', base64Img:''},
    {id: 6, ratio: '1:1', base64Img:''},
    {id: 7, ratio: '1:1', base64Img:''},
  ])

  //test data
  // const [imgPlaceData, setImgPlaceData] = useState<ImgPlaceData[]>([
  //   {ratio: '16:9', left: 113, top: 120, width: 1908, height: 1073, angle: 0, imgSrc: "data:image/jpeg;base64,"},
  //   {ratio: '4:3', left: 1652, top: 1354, width: 1543, height: 1158, angle: 0, imgSrc: "data:image/jpeg;base64,"},
  //   {ratio: '3:4', left: 151, top: 2447, width: 1391, height: 1619, angle: 0, imgSrc: "data:image/jpeg;base64,"},
  //   {ratio: '1:1', left: 1771, top: 3299, width: 1322, height: 1322, angle: 0, imgSrc: "data:image/jpeg;base64,"},
  // ]);

  const [imgPlaceData, setImgPlaceData] = useState<ImgPlaceData[]>([]);

  const updateSlotImage = (index: number, image: string | null) => {
    setImgPlaceData(prevData =>
      prevData.map((slot, i) => (i === index ? { ...slot, imgSrc: image } : slot))
    );
  };

  const renderCurrentStep  = () => {
    switch (mode) {
      case "frame":
        return <FrameSelection />
      case "capture":
        return <PhotoCapture />
      case "compose":
        return <ImageComposer />
      case "generator":
        return <ImageGenerator />
      default:
        return (<div> </div>)
    }
  }

  const contextValue: PhotoCaptureContextType = useMemo(() => ({
    Mode: {
      mode: mode,
      setmode: setMode,
    },
    CaptureImgData: {
      captureImageData: captureImageData,
      setCaptureImgData: setCaptureImgData,
    },
    FrameData: {
      url: url,
      seturl: seturl,
      ImgPlaceData: {
        imgPlaceData: imgPlaceData,
        setimageData: setImgPlaceData,
      },
      updateSlotImage: updateSlotImage,
    },
  }), [
    mode,
    captureImageData,
    imgPlaceData,
  ])

  return (
    <PhotoCaptureContext.Provider value={contextValue}>
      {renderCurrentStep()}
    </PhotoCaptureContext.Provider>
  );
}

export default PhotoShootPage;
